import * as React from "react";
import AppBar from "@mui/material/AppBar";
import Box from "@mui/material/Box";
import Toolbar from "@mui/material/Toolbar";
import Typography from "@mui/material/Typography";
import Button from "@mui/material/Button";
import IconButton from "@mui/material/IconButton";
import MenuIcon from "@mui/icons-material/Menu";
import { Link } from "react-router-dom";
import PersonIcon from "@mui/icons-material/Person";
import HomeIcon from "@mui/icons-material/Home";
import CountrySelect from "./country/countrylist";
import SearchRoundedIcon from "@mui/icons-material/SearchRounded";
import { useContext } from "react";
import SessionContext from "./session/SessionContext";
import PostAddIcon from '@mui/icons-material/PostAdd';
import { useEffect } from "react";
export default function ButtonAppBar() {
  const {
    session: { user },
    actions: { logout, loggedin },
  } = useContext(SessionContext);

  useEffect(() => {
    // Update the document title using the browser API
  }, []);

  return (
    <>
      {loggedin ? (
        <center>

<Box  >
          <AppBar style={{ backgroundColor: "white" }} position="fixed">
            <Toolbar>
              <Link to="/">
                <IconButton style={{ outlineStyle: "none" }}>
                  <HomeIcon fontSize="large"  style={{ color: "#1976d2" }} />
                </IconButton>
              </Link>
              <Link to="/newpost">

              <Typography variant="h6" component="div" >
                <PostAddIcon fontSize="large"  color="primary" />
              </Typography>

              </Link>

              <Link to="profile" >
                <PersonIcon fontSize="large"  xs style={{ color: "primary" , float:"none"}} />
                {/* <Button onClick={logout} variant="contained" color="primary">
                        logout
                      </Button> */}
              </Link>
            </Toolbar>
          </AppBar>
        </Box>
        </center>

      ) : null}
    </>
  );
}
